De film is een parodie op The Hunger Games, The Avengers, Sherlock Holmes en Harry Potter. De hoofdlijn van het verhaal draait om een groep zwaarlijvige tieners die gedwongen wordt zich dood te eten. Het buffet vindt plaats in Las Vegas en wordt georganiseerd door de overheid die van mening is dat het aantal dikke kinderen uit de hand loopt.



